verage it for your business today.\";s:7:\"created\";i:1650978196;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:123:\"https://elementor.com/blog/word-of-mouth-marketing/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:88:\"More From Elementor 3.6 — Enhanced Import/Export and Rearrange Global Fonts and Colors\";s:7:\"excerpt\";s:251:\"In addition to the Flexbox Containers experiment, Elementor 3.6 also includes additions to the Import/Export tool and the ability to customize the order of your Global Fonts and Colors. These updates allow you to improve and accelerate your workflow. \";s:7:\"created\";i:1650456753;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:164:\"https://elementor.com/blog/introducing-enhanced-import-export-rearrange-global-fonts-colors/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:45:\"PowerPack Addons Thought Leadership Interview\";s:7:\"excerpt\";s:274:\"In our latest edition of the Thought Leadership Interview Series, we spoke with the team behind the PowerPack Addons plugin for Elementor. Get an insight into what makes them tick, how their plugin complements Elementor, and their contributions to the Web Creator community.\";s:7:\"created\";i:1650453676;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:145:\"https://elementor.com/blog/powerpack-addons-thought-leadership-interview/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:67:\"12 New Full Kits That Will Accelerate Your Website Creation Process\";s:7:\"excerpt\";s:368:\"Building a professional, & beautiful website should be as hassle-free as possible. That is where website kits come in — to help you get started faster using stunning, pre-designed templates that allow you to achieve professional looking websites. Now imagine an even more convenient way to use these kits as we introduce 12 new Basic Website Kits — 6 Free & 6 Pro.\";s:7:\"created\";i:1650351364;s:5:\"b